static inline real poly(const real *cof, const int n, const real x) {
    real ans = cof[n];
    for (int i=n-1;i>=0;i--) ans = ans*x+cof[i];
    return ans;
}

static inline real besselI0(const real x) {
    real ax = abs(x);
    if (ax < 15.0) {
        real y = x*x;
        return poly(i0p,13,y)/poly(i0q,4,225.-y);
    } else {
        real z=1.0-15.0/ax;
        return exp(ax)*poly(i0pp,4,z)/(poly(i0qq,5,z)*sqrt(ax));
    }
}

static inline real besselI1(const real x) {
    real ax = abs(x);
    if (ax < 15.0) {
        real y=x*x;
        return x*poly(i1p,13,y)/poly(i1q,4,225.-y);
     } else {
        real z=1.0-15.0/ax;
        real ans=exp(ax)*poly(i1pp,4,z)/(poly(i1qq,5,z)*sqrt(ax));
        return ans;
    }
}
static inline real besselK0(const real x) {
    if (x <= 1.0) {
        real z=x*x;
        real term = poly(k0pi,4,z)*log(x)/poly(k0qi,2,1.-z);
        return poly(k0p,4,z)/poly(k0q,2,1.-z)-term;
    } else {
        real z=1.0/x;
        return exp(-x)*poly(k0pp,7,z)/(poly(k0qq,7,z)*sqrt(x));
    }
}

static inline real besselK1(const real x) {
    if (x <= 1.0) {
        real z=x*x;
        real term = poly(k1pi,4,z)*log(x)/poly(k1qi,2,1.-z);
        return x*(poly(k1p,4,z)/poly(k1q,2,1.-z)+term)+1./x;
    } else {
        real z=1.0/x;
        return exp(-x)*poly(k1pp,7,z)/(poly(k1qq,7,z)*sqrt(x));
    }
}

static inline real aExp(const real k, const real R, const real Rd) {
    const real lim = R/Rd;
    const real kRd = k*Rd;
    if ((lim < 100) && (lim > 1.0/12.0) && (kRd < 100) && (kRd > 1.0/12.0)) {    /*Calculate from table using bilinear interpolation*/
        int lim_index = mw_floor(2*lim - 1.0/6.0);
        int kRd_index = mw_floor(2*kRd - 1.0/6.0);
        const real x1 = lim_index*0.5 + 1.0/12.0;
        const real x2 = (lim_index+1)*0.5 + 1.0/12.0;
        const real y1 = kRd_index*0.5 + 1.0/12.0;
        const real y2 = (kRd_index+1)*0.5 + 1.0/12.0;
        const real a11 = aExp_table[lim_index][kRd_index];
        const real a12 = aExp_table[lim_index][kRd_index+1];
        const real a21 = aExp_table[lim_index+1][kRd_index];
        const real a22 = aExp_table[lim_index+1][kRd_index+1];
        real val = 0.25*(a11*(x2 - lim)*(y2 - kRd) + a21*(lim - x1)*(y2 - kRd) + a12*(x2 - lim)*(kRd - y1) + a22*(lim - x1)*(kRd - y1));
        return val;
    } else {    /*Directly calculate*/
        const int n = 5;
        const real a = 0.0;
        const real b = lim;
        real integral = 0.0;
        const real weight[] = {5,8,5};
        const real point[] = {-0.774596669, 0 , 0.774596669};
        const real frac = 9.0;
        const real h = (b-a)/n;

        for (int i = 0; i < n; i++)
        {
        real piece = 0.0;
            for (int j = 0; j < 3; j++)
            {
                real x_val = h*point[j]/2 + a+(i+0.5)*h;
                real funcval = x_val*mw_exp(-x_val)*besselI0(kRd*x_val);
                piece = piece + h*weight[j]*funcval/frac/2.0;
            }
            integral  = integral + piece;
        }
        return integral;
    }
} 

static inline real bExp(const real k, const real R, const real Rd) {
    const real lim = R/Rd;
    const real kRd = k*Rd;
    if ((lim < 100) && (lim > 1.0/12.0) && (kRd < 100) && (kRd > 1.0/12.0)) {    /*Calculate from table using bilinear interpolation*/
        int lim_index = mw_floor(2*lim - 1.0/6.0);
        int kRd_index = mw_floor(2*kRd - 1.0/6.0);
        const real x1 = lim_index*0.5 + 1.0/12.0;
        const real x2 = (lim_index+1)*0.5 + 1.0/12.0;
        const real y1 = kRd_index*0.5 + 1.0/12.0;
        const real y2 = (kRd_index+1)*0.5 + 1.0/12.0;
        const real a11 = bExp_table[lim_index][kRd_index];
        const real a12 = bExp_table[lim_index][kRd_index+1];
        const real a21 = bExp_table[lim_index+1][kRd_index];
        const real a22 = bExp_table[lim_index+1][kRd_index+1];
        real val = 0.25*(a11*(x2 - lim)*(y2 - kRd) + a21*(lim - x1)*(y2 - kRd) + a12*(x2 - lim)*(kRd - y1) + a22*(lim - x1)*(kRd - y1));
        return val;
    } else {    /*Directly calculate*/
        const int n = 8;
        const real a = lim;
        const real b = 20.0*lim;
        real integral = 0.0;
        const real weight[] = {5,8,5};
        const real point[] = {-0.774596669, 0 , 0.774596669};
        const real frac = 9.0;
        const real h = (b-a)/n;

        for (int i = 0; i < n; i++)
        {
            real piece = 0.0;
            for (int j = 0; j < 3; j++)
            {
                real x_val = h*point[j]/2 + a+(i+0.5)*h;
                real funcval = x_val*mw_exp(-x_val)*besselK0(kRd*x_val);
                piece = piece + h*weight[j]*funcval/frac/2.0;
            }
            integral  = integral + piece;
        }
        return integral;
    }
}


static inline real RExpIntegrand (real k, real R, real Rd, real z, real zd)
{
    real val = k*mw_cos(k*z)*(aExp(k,R,Rd)*besselK1(k*R) - bExp(k,R,Rd)*besselI1(k*R))/(sqr(zd*k) + 1);
    //mw_printf("RExp(%.15f,%.15f,%.15f,%.15f,%.15f) = %.15f\n",k,R,Rd,z,zd,val);
    return val;
}

static inline real ZExpIntegrand (real k, real R, real Rd, real z, real zd)
{
    real val = k*mw_sin(k*z)*(aExp(k,R,Rd)*besselK0(k*R) + bExp(k,R,Rd)*besselI0(k*R))/(sqr(zd*k) + 1);
    //mw_printf("ZExp = %.15f\n",val);
    return val;
}

static inline real RSechIntegrand (real k, real R, real Rd, real z, real zd)
{
    real val = sqr(k)*zd/mw_sinh(3.1415926535*k*zd/2.0)*mw_cos(k*z)*(aExp(k,R,Rd)*besselK1(k*R) - bExp(k,R,Rd)*besselI1(k*R));
    //mw_printf("RSech(%.15f,%.15f,%.15f,%.15f,%.15f) = %.15f\n",k,R,Rd,z,zd,val);
    return val;
}

static inline real ZSechIntegrand (real k, real R, real Rd, real z, real zd)
{
    real val = sqr(k)*zd/mw_sinh(3.1415926535*k*zd/2.0)*mw_sin(k*z)*(aExp(k,R,Rd)*besselK0(k*R) + bExp(k,R,Rd)*besselI0(k*R));
    //mw_printf("ZSech = %.15f\n",val);
    return val;
}

